import React, { useState } from "react";
import "./FormPage.css";

function FormPage() {
  const [userType, setUserType] = useState(""); // "donor" or "recipient"
  const [formData, setFormData] = useState({
    age: "",
    bloodGroup: "",
    organType: "",
    hlaTyping: "",
    bmi: "",
    organSize: "",
    infectionStatus: "",
    location: "",
    healthCondition: "",
    urgency: "",
    waitingTime: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form Data Submitted:", formData);
  };

  return (
    <div className="form-container">
      <h2>Register as a Donor or Recipient</h2>

      {/* Donor / Recipient Selection */}
      <div className="user-selection">
        <button className={userType === "donor" ? "active" : ""} onClick={() => setUserType("donor")}>
          Donor
        </button>
        <button className={userType === "recipient" ? "active" : ""} onClick={() => setUserType("recipient")}>
          Recipient
        </button>
      </div>

      {/* Show Form Only After Selection */}
      {userType && (
        <form onSubmit={handleSubmit} className="user-form">
          <input type="number" name="age" placeholder="Age" onChange={handleChange} required />
          <select name="bloodGroup" onChange={handleChange} required>
            <option value="">Select Blood Group</option>
            <option value="A+">A+</option>
            <option value="A-">A-</option>
            <option value="B+">B+</option>
            <option value="B-">B-</option>
            <option value="O+">O+</option>
            <option value="O-">O-</option>
            <option value="AB+">AB+</option>
            <option value="AB-">AB-</option>
          </select>

          <select name="organType" onChange={handleChange} required>
            <option value="">Select Organ Type</option>
            <option value="Lungs">Lungs</option>
            <option value="Heart">Heart</option>
            <option value="Liver">Liver</option>
            <option value="Kidney">Kidney</option>
          </select>

          {/* Donor-Specific Fields */}
          {userType === "donor" && (
            <>
              <input type="text" name="hlaTyping" placeholder="HLA Typing" onChange={handleChange} required />
              <input type="number" name="bmi" placeholder="BMI" onChange={handleChange} required />
              <input type="text" name="organSize" placeholder="Organ Size" onChange={handleChange} required />
            </>
          )}

          {/* Common Fields */}
          <input type="text" name="infectionStatus" placeholder="Infection Status (if any)" onChange={handleChange} />
          <input type="text" name="location" placeholder="Geographic Location" onChange={handleChange} required />
          <input type="text" name="healthCondition" placeholder="Health Condition ()" onChange={handleChange} required />

          {/* Recipient-Specific Fields */}
          {userType === "recipient" && (
            <>
              <input type="number" name="bmi" placeholder="BMI" onChange={handleChange} required />
              <select name="urgency" onChange={handleChange} required>
                <option value="">Select Urgency Level</option>
                <option value="low">Low</option>
                <option value="medium">Medium</option>
                <option value="high">High</option>
              </select>
              <input type="number" name="waitingTime" placeholder="Waiting Time (in days)" onChange={handleChange} required />
            </>
          )}

          <button type="submit" className="submit-btn">Submit</button>
        </form>
      )}
    </div>
  );
}

export default FormPage;
